// SPDX-License-Identifier: MIT
pragma solidity ^0.8.4;

import "@openzeppelin/contracts/utils/Timers.sol";

contract UMRproposal {
    using Timers for Timers.BlockNumber;

    struct ProposalCore {
        Timers.BlockNumber donationStart;
        Timers.BlockNumber donationEnd;
        uint256 donateMinimum;
        bool executed;
        bool canceled;
    }

    mapping(uint256 => ProposalCore) private _proposals;

    function hashProposal(
        address proposer,
        address destination,
        bytes[] memory calldatas,
        bytes32 descriptionHash
    ) public pure returns (uint256) {
        return uint256(keccak256(abi.encode(proposer,destination, calldatas, descriptionHash)));
    }

    function proposal(
        address proposer,
        uint256 donateDelay, // n*13.5s 후 기부 시작
        uint256 donatePeriod, // n * 13.5s 후 기부 종료 //45818 = 1 week
        uint256 donateMinimum, // 0.5 = 0.5ETH
        address destination, // 기부단체 주소
        string memory description, // 기부 안건 내용
        bytes[] memory calldatas
    ) public returns(uint256) {
        uint256 proposalId = hashProposal(proposer,destination, calldatas, keccak256(bytes(description)));

        ProposalCore storage proposal = _proposals[proposalId];

        uint64 snapshot = uint64(block.number) + uint64(donateDelay);
        uint64 deadline = snapshot + uint64(donatePeriod);

        proposal.donationStart.setDeadline(snapshot);
        proposal.donationEnd.setDeadline(deadline);
        proposal.donateMinimum = donateMinimum;
        return proposalId;
    }
}

